INSERT INTO `ym_books` VALUES ('62', 'جزوه جملات تاکیدی مثبت', 'REI5f1488556304.pdf', 'kaxcF1488557526.jpg', '<p>آیا می دانید جملات تاکیدی چه هستند؟ آیا می دانید به چه کاری می آیند؟ این جملات ، جملاتی هستند که از طریق آنها می توان به آنچه که انسان ازخود دور شده است برسد به بیانی ساده جملات مثبت در جهت رسیددن به خویشتنی واقعی است . که اگر بدانید از هر کدام از آنها در چه زمانی استفاده کنید می توانید بهترین بهره را از آن ببرید. استفاده از تلقین و تکرار عبارت های تاکیدی مثبت یکی از قدیمی ترین تکنیک هایی است که برای کسب موفقیت و تغییر باورر ها استفاده می شود. علت این امر را باید در تعریف باور جست و جو کرد. باور فکر یا ایده ای است که بارها و بارها و بارها تکرار شده تا در نهایت از فیلتر ضمیر خود آگاه عبور کند و بر ضمیر ناخود آگاه نشسته و در آن حک شود. استفاده از عبارت های تاکیدی مثبت در کنار تمرینات خود هیپنوتیزم می تواند سرعت دستیابی به اهدافی که دارید را چند برابر کند چون در این مرحله ضمیر خود آگاه شما نیز به ضمیر ناخود آگاه تان ملحق شده تا هر دو در یک راستا، منابع و شرایط خلق اهداف تان را ایجاد کنند.</p>\n', '20', '', 'فارسی', 'enable', null, '54', null, '43', null, 'accepted', null, '633', '1', '0', null);
INSERT INTO `ym_books` VALUES ('63', 'ذهن ثروتمند ذهن فقیر', '2oLUL1488558652.pdf', '1M3TL1549572756.jpg', '<p>و این کتاب درباره مسائلی صحبت میکنم که اگه با دقت و با حوصله اونارو بخونی و عمل کنی بهت قول میدم حس بسیار عالی پیدا کنی و حس کنی خودت خالق زندگیت هستی و با اطمینان بهت میگم که این زندگی ما حصل تفکر، تلاش و کوشش خود منه و نتیجش هر چی که هست باعثش خودم هستم. با خوندن مطالب این کتاب کنترل زندگیت رو بدست میگیری و از زندگی روزمره و بی هدف خلاص میشی.</p>\n', '73', '', 'فارسی', 'enable', null, '54', null, '103', null, 'accepted', null, '598', '6', '0', null);
