INSERT INTO `ym_books` VALUES ('65', 'پستچی', '', 'C47rP1502717889.jpg', '<p>چیستا یثربی( _۱۳۴۷)، نویسنده و روان‌شناس است.</p>\n\n<p>شاگرد اول دیپلم تجربی شد و رتبه پنج کنکور سراسری را کسب کرد.</p>\n\n<p>فوق لیسانس روانشناسی‌اش را از دانشگاه الزهرا و دکترای خود را از تورنتوی کانادا گرفت و اکنون در دانشگاه‌ها به تدریس مشغول است.</p>\n\n<p>یثربی از ۱۳۶۸ به فعالیت در تئاتر می‌پردازد.</p>\n\n<p>بیش از ۲۰ نمایشنامه نوشته و آثاری چون «سرخ سوزان»، «یک شب دیگر هم بمان سیلویا»، «چنگیزخان»، «میرزاده عشقی» و ... را کارگردانی کرده است.</p>\n\n<p>او فیلمنامه‌های زیادی نوشته که از جمله آنها می‌توان به «دعوت» ابراهیم حاتمی‌کیا اشاره کرد.</p>\n', '100', '', 'فارسی', 'enable', null, '54', null, '43', null, 'accepted', null, '366', '1', '0', null);
INSERT INTO `ym_books` VALUES ('66', 'کلام امیر: حکمت های امیرالمونین حضرت علی(ع)', '', 'xKnoN1549572624.jpg', '<p>«کلام امیر: حکمت‌های امیرالمونین حضرت علی(ع)» مجموعه‌ای شامل ۴۸۰ تا از اندرزها، سخنان و جملات قصار امام اول شیعیان است که توسط سید شریف رضی، سید علی رضا و محمد دشتی به صورت متن دوزبانه، گردآوری و ترجمه شده است.</p>\n', '174', '', 'فارسی و انگلیسی', 'enable', null, '54', null, '43', null, 'accepted', null, '220', '0', '0', null);
INSERT INTO `ym_books` VALUES ('67', 'مربای انجیر', '', 'PaMiz1549572546.jpg', '<div>\n<p>زری داشت از ماشین پیاده می‌شد. قفل درها را زد. تقی خورد کلیدها. کیف روی دوش انداخته‌بود و داشت به سمت دره باریکه‌ی درکه راه می‌رفت. کفش‌های پاشنه بلند قرمزی پاش بود. به سختی می‌شد با آن ارتفاع راست ایستاد. مچ پاش در هر بار راه رفتن پیچ می‌خورد. عینک بزرگ قاب سفیدی را به چشم‌های مکعبی‌ش آویخت، عینک صورتش را تا نصف پوشانده بود. شبیه هیچکس نبود. شصت سال پیش کسی خبر از سرنوشت معجزه آسای میدان انقلاب را که امروزه ساکنان شهر آن را این گونه می‌بینند تصور نمی‌کرد. جرات نمی‌کرد پیش‌بینی کند. تاریخ را کسانی که گل‌آلود بودن این خیابان‌ها را دیده است می‌تواند به قلم بیاورد. آن‌هایی که سرد و گرم خیابان‌ها و کوچه‌های کاه و گلی‌اش را دیده اند.</p>\n\n<p>– با توام کامران. کجایی؟</p>\n\n<p>- درکه.</p>\n\n<p>– چی.....؟؟؟</p>\n\n<p>زری برگشت عقب. بیا دیگه عزیزم. با من بود. صدا رفت آن طرف گوشی. زری شنید. مطمئن بودم شنید که کسی مرا صدازد بیا دیگه عزیزم. تلفن را قطع کردم. سرازیری درکه را پائین رفتم. زری ایستاد نگاهم کرد. من خودم را گم کردم. راهم را گم کردم. زری را هم. دست به جیب بردم. یکی از آن قرص‌های آبی‌رنگ ریزدانه را از پوستش کندم. گذاشتم روی زبان. مکیدمش. تلخیِ طعم تندش آب بزاقم را پراند. دست‌هام را گذاشتم توی جیب شلوار. با هرگامی که برمی‌داشتم استخوان‌های پایم می‌شکست. صدای به‌هم خوردن یا نه، صدای سائیدگیِ بین مفصل‌ها مورمورم می‌کرد. دست بلندکردم به سمت سواریِ در حال عبور. ترمز زد چند قدم پائین‌تر. شیشه را کشید. توی چشم‌هام رفت. گفتم:</p>\n\n<p>- انقلاب؟»</p>\n</div>\n', '88', '', 'فارسی', 'enable', null, '54', null, '43', null, 'accepted', null, '225', '0', '0', null);
INSERT INTO `ym_books` VALUES ('68', 'زال و رودابه', 'cEZ871509203033.pdf', 'Q4fLO1549572436.jpg', '<p>«زال و رودابه (۲)» داستانی مصور برگرفته از شاهنامه‌ی فردوسی، به زندگی زال فرزند سام، و ازدواج او با رودابه می‌پردازد. نویسندگی و تصویرگری این اثر را سید مصطفی حسینی (-۱۳۵۸) بر عهده داشته است.</p>\n', '36', '', 'فارسی', 'enable', null, '54', null, '45', null, 'accepted', null, '265', '7', '0', null);
INSERT INTO `ym_books` VALUES ('69', 'یک قمقمه دریا', 'WsAWt1509202725.pdf', 'fOx4J1549572140.jpg', '<div>\n<p>«یک قمقمه دریا» به قلم محمدهادی زاهدی (-۱۳۴۶) به روایت زندگانی امام هشتم شیعیان می‌پردازد.</p>\n</div>\n', '120', '', 'فارسی', 'enable', null, '54', null, '43', null, 'accepted', null, '241', '2', '0', null);
INSERT INTO `ym_books` VALUES ('70', 'پری‌خوانی عشق و سنگ', '', 'XMpdt1502720151.jpg', '<div>\n<p>«پری‌خوانی عشق و سنگ» دربردارنده سه نمایشنامه از چیستا یثربی(-۱۳۴۷)، نویسنده و نمایشنامه‌نویس معاصر ایرانی است.</p>\n\n<p>«پری‌خوانی عشق و سنگ»، «با صحرا بخوان، بی‌صدا» و «جریره بر اساس شاهنامه فردوسی» سه نمایشنامه آمده در این کتاب هستند.</p>\n\n<p>در بخشی از کتاب می‌خوانیم:</p>\n\n<p>(زنی چهره‌پوشیده در قالب مردی ظاهر می‌شود. مردی در حال زنگوله بستن به ستوران و خواندن آوازی زیر لب. زن با کوله‌پشتی‌اش وارد می‌شود.)</p>\n\n<p>زن: چارپادار...</p>\n\n<p>(مرد همچنان می‌خواند.)</p>\n\n<p>زن: (با فریاد) های! چارپادار...</p>\n\n<p>مرد: فریاد می‌زنی اول صبح؟</p>\n\n<p>زن: صبح است و وقت کار.</p>\n\n<p>مرد: آری، اما تو خروس نیستی جوان! فریادت را هفت محله شنیدند.</p>\n\n<p>زن: به صدای آهسته، کسی پاسخم نگفت.</p>\n\n<p>مرد: چه می‌خواهی؟</p>\n\n<p>زن: از این چارپایانت کدام یک پرطاقت‌تر است؟</p>\n\n<p>مرد: تا مقصد کجا باشد...</p>\n\n<p>زن: هر جا... تو بیندیش راه دل!</p>\n\n<p>مرد: راه دل با مرکب نمی‌روند و تو دشت امروز من نیستی.</p>\n\n<p>زن: اگر راه دلم سوی خانه خدا باشد؟</p>\n\n<p>مرد: خانه خدا؟ (مکث) پس اسبی پرطاقت می‌خواهی و درشکه‌ای.</p>\n\n<p>زن: و درشکه‌بان.</p>\n\n<p>مرد: درشکه‌بانت را نزد من بفرست!</p>\n</div>\n', '110', '', 'فارسی', 'enable', null, '54', null, '43', null, 'accepted', null, '237', '2', '0', null);
INSERT INTO `ym_books` VALUES ('71', 'عاشق ابر سپید', '', 'owNwY1502724708.jpg', '<p>«عاشق ابر سپید» نمایشنامه‌ای است از چیستا یثربی( -۱۳۴۷)، نویسنده و نمایشنامه‌نویس ایرانی. داستان پیرامون یک چشم‌پزشک موفق به نام مرجان جهان‌بین است که با گونه‌ خاصی از وسواس در روابط خود رو به رو می‌شود.</p>\n', '100', '', 'فارسی', 'enable', null, '54', null, '43', null, 'accepted', null, '229', '0', '0', null);
INSERT INTO `ym_books` VALUES ('72', 'روانشماسی غیرنرمال', 'nXf3C1518637498.epub', 'rHIzC1549572087.jpg', '<p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>\n', '452', '', 'انگلیسی', 'enable', null, '60', null, '76', null, 'accepted', null, '89', '2', '0', null);
INSERT INTO `ym_books` VALUES ('73', 'روان و رفتار در اعتیاد', '', 'c62lO1549571998.jpg', '<p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>\n\n<p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>\n\n<p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>\n', '235', '', 'فارسی', 'enable', null, '52', null, '43', null, 'accepted', null, '95', '0', '0', null);
INSERT INTO `ym_books` VALUES ('74', 'اسکار و خانم صورتی', '', 'G8qPD1551368992.jpg', '<p>معرفی کتاب اسکار و خانم صورتی</p>\n\n<p>«اسکار و خانم صورتی» اثری از اریک امانوئل اشمیت (-۱۹۶۰) نویسنده، نمایشنامه‌نویس و کارگردان فرانسوی- بلژیکی است که در سال‌های اخیر محبوبیت زیادی به خصوص در دنیای تئاتر به‌دست آورده‌ است. نمایش‌نامه‌های او در بیش از ۵۰ کشور جهان به روی صحنه رفته‌اند و جوایز متعددی از جمله جایزه تئاتر مولیر، داستان‌نویسی گنکور و آکادمی بالزاک را از آن خود کرده‌اند. او دکترای فلسفه دارد و مضامین فلسفی را به‌راحتی با داستان‌هایش می‌آمیزد. اشمیت در خانواده‌ای غیرمذهبی متولد شد و شاید این موضوع باعث شد که اهمیت دین در آثارش پررنگ باشد. در این اثر نیز که درواقع صحبت‌های قهرمان داستان با خدا است، مسیحیت نمودی ویژه دارد.</p>\n\n<p>اشمیت سرانجام به آیین مسیح گروید و خود را مسیحی معرفی کرد.</p>\n\n<p>اسکار و خانم صورتی داستان لطیفی در مورد پسربچه ده ساله‌ای است که در بیمارستان آخرین روزهای زندگی را می‌گذراند. او هر روز به خدا یک نامه می‌نویسد و پیرزنی مهربان با لباس صورتی که مرتب به دیدار کودکان می‌آید آنها را پیدا می‌کند:</p>\n\n<p>خداجونی!</p>\n\n<p>من اسکارم، ده سالمه، تو خونه گربه و سگ رو آتیش زدم (فکر کنم حتی ماهی گلی هم کباب کرده باشم!) اولین‌باره که برات نامه می‌نویسم چون تا حالا به‌خاطر درس‌هام وقت نداشتم.</p>\n\n<p>باید همین اول بهت بگم که من حالم از نوشتن به هم می‌خوره، وقتی که دیگه واقعاً مجبور باشم می‌نویسم؛ چون نوشتن یه چیز الکیه، یه چیز تزئینی. مثل لبخند زورکی، حلقه‌ی گل و روبان و منگوله و این چیزها؛ نوشتن یه دروغه که همه‌چیزو خوب نشون میده؛ یه کلک آدم بزرگونه‌س، مدرکش؟ بفرما، اول نامه‌م رو دوباره بخون:</p>\n\n<p>«من اسکارم، ده سالمه، تو خونه گربه و سگ رو آتیش زدم (فکر کنم حتی ماهی گلی هم کباب کرده باشم!) اولین‌باره که برات نامه می‌نویسم چون تا حالا به‌خاطر درس‌هام وقت نداشتم.»</p>\n\n<p>می‌تونستم خیلی راحت به‌جای این‌ها بنویسم:</p>\n\n<p>«بهم میگن کله‌تخم‌مرغی، هفت‌ساله به نظر می‌رسم، به‌خاطر سرطانم تو بیمارستان زندگی می‌کنم و هیچ‌وقت نوشته‌ای برات نفرستادم چون فکر نمی‌کنم حتی وجود داشته باشی!»</p>\n', '80', '', 'فارسی', 'enable', null, '57', null, '101', null, 'pending', null, '0', '0', '0', null);
