INSERT INTO `ym_news` VALUES ('16', 'خبر تست', 'لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است.', '<p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. <em>چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته،</em> حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. <strong>در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</strong></p>\n\n<p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای <span style=\"font-size:14px;\">متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد</span> تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت<span style=\"color:#A52A2A;\"> که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پ</span>یوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>\n\n<p>لورم ایپسوم متن <span style=\"font-family:\'comic sans ms\', cursive;\">ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جا</span>معه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>\n', 'smrLO1483356789.jpg', '304', '1483356906', '1483356906', 'publish', '4', null);
INSERT INTO `ym_news` VALUES ('17', 'برگزیدگان نخستین کنگره ملی شعر کتاب معرفی شدند.', 'حمیدرضا برقعه‌ای، دبیر نخستین کنگره شعر کتاب در این مراسم با ارائه گزارشی از روند برگزاری این کنگره ملی گفت: بیش از 1700 اثر در 5 بخش شعر کلاسیک، سپید و نیمایی، ترانه، طنز و بخش کودک و نوجوان به دبیرخانه این کنگره ملی رسید که این میزان مشارکت در مقایسه با کنگره‌های دیگر، آمار قابل توجهی ارزیابی می‌شود.', '<p>به این خبر دقت کنید.</p>\n', 'qGMGa1488384738.jpg', '0', '1488384946', null, 'draft', '4', null);
INSERT INTO `ym_news` VALUES ('18', 'برگزیدگان نخستین کنگره ملی شعر کتاب معرفی شدند.', 'به گزارش خبرگزاری کتاب ایران (ایبنا)، مراسم اختتامیه نخستین کنگره ملی شعر کتاب عصر امروز چهارشنبه (11 اسفند) با حضور سیدرضا صالحی امیری، وزیر فرهنگ و ارشاد اسلامی، علیرضا مختارپور، دبیرکل نهاد کتابخانه‌های عمومی کشور، محمدعلی مجاهدی، محمدعلی بهمنی و اسماعیل آذر از شاعران پیشکسوت کشور، جمعی از چهره‌های برجسته حوزه شعر و کتابداران با معرفی و قدردانی از برگزیدگان در سالن اجتماعات کتابخانه عمومی محقق حلی تهران برگزار شد.', '<p>به گزارش خبرگزاری کتاب ایران (ایبنا)، مراسم اختتامیه نخستین کنگره ملی شعر کتاب عصر امروز چهارشنبه (11 اسفند) با حضور سیدرضا صالحی امیری، وزیر فرهنگ و ارشاد اسلامی، علیرضا مختارپور، دبیرکل نهاد کتابخانه‌های عمومی کشور، محمدعلی مجاهدی، محمدعلی بهمنی و اسماعیل آذر از شاعران پیشکسوت کشور، جمعی از چهره‌های برجسته حوزه شعر و کتابداران با معرفی و قدردانی از برگزیدگان در سالن اجتماعات کتابخانه عمومی محقق حلی تهران برگزار شد.</p>\n', 'n5i7h1488385167.jpg', '254', '1488385280', '1488385280', 'publish', '4', null);
INSERT INTO `ym_news` VALUES ('19', 'ضحی کاظمی از انتشار داستان تازه‌اش خبر داد.', 'به گزارش خبرگزاری کتاب ایران (ایبنا)، ضحی کاظمی نویسنده، مترجم و ستون‌نویس نشریات و مطبوعات به‌تازگی رمان «کاج‌زدگی» را منتشر کرده است.\n \nکاظمی درباره سبک کتاب «کاج‌زدگی» گفت: همیشه ژانر علمی‌تخیلی ژانر مورد علاقه من بوده است. هم کتاب، هم فیلم و هم سریال.', '<p>حتی موسیقی و نقاشی‌های نزدیک به این ژانر را خیلی دوست دارم. ژانرنویسی در ایران سابقه مشخصی ندارد. به نوعی برای من راه رفتن در تاریکی بود و البته بسیار لذت بخش. ژانر برای بیان مفاهیم پایه‌ای امکانات خوبی به نویسنده می‌دهد. دست نویسنده را برای خلاقیت و قصه‌گویی و در عین حال بیان مضامین عمیق باز می‌کند.<br />\n <br />\nاین نویسنده با بیان این‌که «داستان کاج‌زدگی هم علمی‌تخیلی است»، اظهار کرد: داستان‌های علمی‌تخیلی فضاهای مخصوص به خودشان را دارند، دنیای داستانی منحصر به فرد و مربوط به داستانی که روایت می‌شود. این رمان هم از این نظر استثنا نیست. در رمان به شهر قدیمی که در زمان داستان مخروبه‌ای رها شده است اشاره می‌شود و به شهر جدید که قرار بوده آرمان‌شهری زیبا و منظم باشد اما اتفاقات هولناک داستان از این شهر آغاز می‌شود.</p>\n', 'HcCB61489041033.jpg', '0', '1489041108', null, 'draft', '4', null);
